import React, {Component} from 'react';
import {Menu} from "antd";
const {SubMenu}=Menu;
import adminNavStyle from './index.module.css';

class AdminNav extends Component {
    render() {
        return (
            <Menu mode='inline' className={adminNavStyle.menu}>
                <SubMenu key='ManagerMembers' title='成员管理'>
                    <Menu.Item key='AddMember'>添加成员</Menu.Item>
                    <Menu.Item key='AddMember'>查找成员</Menu.Item>
                </SubMenu>
                <SubMenu key='ManagerGroup' title='组织管理'>
                    <Menu.Item key='AddMember'>添加组织</Menu.Item>
                    <Menu.Item key='AddMember'>查找组织</Menu.Item>
                </SubMenu>
            </Menu>
        );
    }
}

export default AdminNav;
